            this.label16.TabIndex = 21;
            this.label16.Text = "五、盘腔扫描：①检查前一晚晚餐进食半流质食物，如面包、面条、粥等，晚８时用开水冲服番泻叶10克或酌情增加清洁肠道。②报到前1小时饮温开水300毫升。③已婚妇女阴道" +
