            this.label27.Text = "4、由于静脉注射对比剂是电脑控制高压快速注射器进行，存在注射针头脱落、局部血管破裂等潜在危险，注射部位可能出现碘对比剂渗漏造成皮下软组织肿胀＼疼痛。若出现上述情况" +
